import React from 'react'

const Header = ({text,bgcolor,clr,pad,size,fw,ws}) => {
  
const HeaderStyle = {
    backgroundColor:bgcolor,
    color:clr,
    padding:pad,
    fontSize:size,
    fontWeight: fw,
    wordSpacing: ws
}

  return (
    <div style={{wordSpacing}}>
        <h2 style ={HeaderStyle}>{text}</h2>
    </div>
  )
}

Header.defaultProps = {
    text: 'FEEDBACK UI',
    pad: '30px 0 30px 0',
    bgcolor: 'lightBlue',
    clr: 'rgb(152, 23, 0)',
    size: '30px',
    fw:'900'
}

export default Header;
